package com.fishercoder.firstthousand;

import com.fishercoder.solutions.firstthousand._459;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

public class _459Test {
    private _459.Solution1 solution1;
    private _459.Solution2 solution2;
    private _459.Solution3 solution3;

    @BeforeEach
    public void setup() {
        solution1 = new _459.Solution1();
        solution2 = new _459.Solution2();
        solution3 = new _459.Solution3();
    }

    @Test
    public void test1() {
        assertEquals(true, solution1.repeatedSubstringPattern("abab"));
        assertEquals(true, solution2.repeatedSubstringPattern("abab"));
        assertEquals(true, solution3.repeatedSubstringPattern("abab"));
    }

    @Test
    public void test2() {
        assertEquals(false, solution1.repeatedSubstringPattern("aba"));
        assertEquals(false, solution2.repeatedSubstringPattern("aba"));
        assertEquals(false, solution3.repeatedSubstringPattern("aba"));
    }

    @Test
    public void test3() {
        assertEquals(false, solution1.repeatedSubstringPattern("a"));
        assertEquals(false, solution2.repeatedSubstringPattern("a"));
        assertEquals(false, solution3.repeatedSubstringPattern("a"));
    }

    @Test
    public void test4() {
        assertEquals(false, solution1.repeatedSubstringPattern(""));
        assertEquals(false, solution2.repeatedSubstringPattern(""));
        assertEquals(false, solution3.repeatedSubstringPattern(""));
    }

    @Test
    public void test5() {
        assertEquals(true, solution1.repeatedSubstringPattern("ababab"));
        assertEquals(true, solution2.repeatedSubstringPattern("ababab"));
        assertEquals(true, solution3.repeatedSubstringPattern("ababab"));
    }

    @Test
    public void test6() {
        assertEquals(false, solution1.repeatedSubstringPattern("abababc"));
        assertEquals(false, solution2.repeatedSubstringPattern("abababc"));
        assertEquals(false, solution3.repeatedSubstringPattern("abababc"));
    }

    @Test
    public void test7() {
        assertEquals(false, solution1.repeatedSubstringPattern("abababaaba"));
        assertEquals(false, solution2.repeatedSubstringPattern("abababaaba"));
        assertEquals(false, solution3.repeatedSubstringPattern("abababaaba"));
    }
}
